package fr.creasport.webgestionstock.metier;

public class Pays {
	private int pa_id;
	private String pa_code;
	private String pa_nom;

	public Pays() {
		// TODO Auto-generated constructor stub
	}

	public int getPa_id() {
		return pa_id;
	}

	public void setPa_id(int pa_id) {
		this.pa_id = pa_id;
	}

	public String getPa_code() {
		return pa_code;
	}

	public void setPa_code(String pa_code) {
		this.pa_code = pa_code;
	}

	public String getPa_nom() {
		return pa_nom;
	}

	public void setPa_nom(String pa_nom) {
		this.pa_nom = pa_nom;
	}

}
